#include <stdio.h>
#include <string.h>
#include <stdlib.h>

long long numberOfPowerfulInt(long long start, long long finish, int limit, char* s) {
    long long count = 0;
    long long sInt = atoll(s);
    int sLen = strlen(s);
    long long pow10sLen = 1;
    for (int i = 0; i < sLen; i++) pow10sLen *= 10;

    // Generate all prefixes with digits up to 'limit'
    long long prefix = 0;
    while (1) {
        long long num = prefix * pow10sLen + sInt;
        if (num > finish) break; // Stop if the number exceeds the finish value
        if (num >= start && num <= finish) count++; // Count if within the range

        if (prefix == 0) prefix = 1; // Initial case
        else {
            long long temp = prefix;
            int isValid = 1;
            while (temp > 0) {
                if (temp % 10 == limit) temp /= 10;
                else {
                    temp = temp / 10 * 10 + (temp % 10 + 1); // Increment the last non-limit digit
                    while ((temp * pow10sLen + sInt) <= finish && temp % 10 <= limit) {
                        if ((temp * pow10sLen + sInt) >= start) count++; // Count if within the range
                        temp = temp * 10; // Append a lower digit
                    }
                    prefix = temp;
                    isValid = 0;
                    break;
                }
            }
            if (isValid) break; // If all digits are 'limit', no further prefixes are valid
        }
    }
    return count;
}
